import React, { useState, useEffect } from "react";

function Home() {
  const [homes, setHomes] = useState([]);
  const [searchInput, setSearchInput] = useState("");
  const [suggestedAddresses, setSuggestedAddresses] = useState([]);

  useEffect(() => {
    fetchHomes();
  }, []);

  const fetchHomes = async () => {
    try {
      const response = await fetch(
        "https://api.secondhomeseniors.com/items/home"
      );
      if (response.ok) {
        const data = await response.json();
        setHomes(data.data);
      } else {
        console.error("Error fetching homes:", response.status);
      }
    } catch (error) {
      console.error("Error fetching homes:", error);
    }
  };

  const handleInputChange = (event) => {
    setSearchInput(event.target.value);
    suggestAddresses(event.target.value);
  };

  const suggestAddresses = (input) => {
    const suggestions = homes.filter((home) =>
      home.address.toLowerCase().includes(input.toLowerCase())
    );
    setSuggestedAddresses(suggestions);
  };

  return (
    <div>
      <h1>Homes</h1>
      <input
        type="text"
        value={searchInput}
        onChange={handleInputChange}
        placeholder="Search by address"
      />
      <ul>
        {suggestedAddresses.map((home) => (
          <li key={home.id}>{home.address}</li>
        ))}
      </ul>
    </div>
  );
}

export default Home;
